// ===============================
// XP.CSS TABS (leaving as-is)
// ===============================
(function () {
  document.addEventListener("DOMContentLoaded", function () {
    document.querySelectorAll('.window [role="tablist"]').forEach((tablist) => {
      const tabs = tablist.querySelectorAll("button");

      tabs.forEach((tab) => {
        tab.addEventListener("click", () => {
          const windowBody = tab.closest(".window-body");

          tabs.forEach((t) => t.setAttribute("aria-selected", "false"));
          tab.setAttribute("aria-selected", "true");

          windowBody.querySelectorAll('[role="tabpanel"]').forEach((panel) => {
            panel.hidden = true;
          });

          const targetID = tab.getAttribute("aria-controls");
          const panel = windowBody.querySelector("#" + targetID);
          if (panel) panel.hidden = false;
        });
      });
    });
  });
})();

// ===============================
// DOWNLOAD / STREAM / LYRICS LOGIC
// ===============================

document.addEventListener("DOMContentLoaded", function () {
  // -------------------------------
  // 1. DOWNLOAD BUTTON
  // -------------------------------
  const downloadButton = document.querySelector("#download button");
  const downloadOptions = {
    "SPRY EP (.zip)": "SPRY_EP.zip",
    "lack/lustre": "01_LACKLUSTRE.mp3",
    Pal: "03_PAL.mp3",
    "Look(*Stare)": "03_LOOK(STARE).mp3",
    Skyglide: "04_SKYGLIDE.mp3",
    CORD2: "05_CORD2.mp3",
  };

  downloadButton?.addEventListener("click", () => {
    const selected = document.querySelector(
      '#download input[type="radio"]:checked'
    );
    if (!selected) return;

    const label = selected.nextElementSibling.textContent.trim();
    const file = downloadOptions[label];

    if (file) window.location.href = file;
  });

  // -------------------------------
  // 2. STREAM BUTTON
  // -------------------------------
  const streamButton = document.querySelector("#stream button");
  const streamOptions = {
    "Apple Music": "https://aaa.com",
    Bandcamp: "https://bbb.com",
    Spotify: "https://ccc.com",
    Tidal: "https://ddd.com",
    YouTube: "https://eee.com",
  };

  streamButton?.addEventListener("click", () => {
    const selected = document.querySelector(
      '#stream input[type="radio"]:checked'
    );
    if (!selected) return;

    const label = selected.nextElementSibling.textContent.trim();
    const url = streamOptions[label];

    if (url) window.open(url, "_blank");
  });

  // -------------------------------
  // 3. LYRICS BUTTON
  // -------------------------------
  const lyricsButton = document.querySelector("#lyrics button");
  const lyricsOptions = {
    "lack/lustre": "lacklustre.html",
    Pal: "pal.html",
    "Look(*Stare)": "lookstare.html",
    Skyglide: "skyglide.html",
    CORD2: "cord2.html",
  };

  lyricsButton?.addEventListener("click", () => {
    const selected = document.querySelector(
      '#lyrics input[type="radio"]:checked'
    );
    if (!selected) return;

    const label = selected.nextElementSibling.textContent.trim();
    const file = lyricsOptions[label];

    if (file) window.open(file, "_blank");
  });
});
